import React, { Component } from 'react';

class Like extends Component {
    render() {
        console.log(this.props)
        const {liked,onLike,movieId} = this.props;
        console.log(liked)
        return ( 
            <i className={liked ? "fa fa-heart" : "fa fa-heart-o"} onClick={onLike(movieId)} aria-hidden="true" />
         );
    }
}
 
export default Like;
